use master
go
create database [RescuePet]
go
use [RescuePet]
go
--User Table--
create table [dbo].[Users](
[ID][int]identity(1,1) not null,
[FirstName][nvarchar](50)not null,
[LastName][nvarchar](50)not null,
[PhoneNumber][nvarchar](15)not null,
constraint[PK_Users] primary key clustered([ID] Asc)) on [PRIMARY]
go
--PetType Table--
create table [dbo].[PetTypes](
[ID][int] identity(1,1) not null,
[TypeName][nvarchar](50) not null,
constraint[PK_PetTypes] primary key clustered([ID] asc)) on [PRIMARY]
go
--Pet Breed Table--
create table [dbo].[PetBreeds](
[ID][int]identity(1,1)not null,
[BreedName][nvarchar](50) not null,
[PetTypeID][int]not null,
constraint [PK_PetBreeds] primary key clustered([ID] asc)) on [PRIMARY]
go
--Locations Table--
create table [dbo].[Locations](
[ID][int]identity(1,1) not null,
[LocationName][nvarchar](100) not null,
constraint [PK_Locations] primary key clustered([ID] asc)) on [PRIMARY]
go
--Pet Table--
create table [dbo].[Pets](
[ID][int]identity(1,1) not null,
[Name][nvarchar](50) not null,
[PetTypeID][int]not null,
[BreedID][int] not null,
[LocationID][int] not null,
[Age][int] not null,
[Weight][decimal](5,2) not null,
[Gender][nvarchar](10) not null,
[PetStory][nvarchar](max) not null,
[Status][nvarchar](20) not null default 'Available',
[PostedByUserID][int]not null,
[AdoptedByUserID][int] null,
[B64Image][nvarchar](max) not null,
constraint [PK_Pets] primary key clustered([ID] asc)) on [PRIMARY]
go
--Donations Table--
create table[dbo].[Donations](
[ID][int] identity(1,1) not null,
[UserID][int] not null,
[Amount][decimal](10,2) not null,
[DonationDate][datetime] not null default getdate(),
constraint [PK_Donations] primary key clustered([ID] asc)) on [PRIMARY]
go
--Foreign Key constraints--
alter table [dbo].[PetBreeds] with check add constraint [FK_PetBreeds_PetTypes] foreign key([PetTypeID]) references [dbo].[PetTypes]([ID])
go
alter table [dbo].[Pets] with check add constraint [FK_Pets_PetTypes] foreign key([PetTypeID]) references [dbo].[PetTypes]([ID])
go
alter table [dbo].[Pets] with check add constraint [FK_Pets_PetBreeds] foreign key([BreedID]) references [dbo].[PetBreeds]([ID])
go
alter table [dbo].[Pets] with check add constraint [FK_Pets_Locations] foreign key([LocationID]) references [dbo].[Locations]([ID])
go
alter table [dbo].[Pets] with check add constraint [FK_Pets_PostedBy] foreign key([PostedByUserID]) references [dbo].[Users]([ID])
go
alter table [dbo].[Pets] with check add constraint [FK_Pets_AdoptedBy] foreign key([AdoptedByUserID]) references [dbo].[Users]([ID])
go
alter table [dbo].[Donations] with check add constraint [FK_Donations_Users] foreign key ([UserID]) references [dbo].[Users]([ID])
go
use [master]
go
alter database [RescuePet] set read_write
go
